pragma solidity >=0.8.4;

interface IPositionStorage {
    struct BaseToken {
        address id;
        uint256 amount;
        uint256 entryPrice;
        uint256 liqPrice;
        uint256 closePrice;
        uint256 inverted;
    }
    struct QuoteToken {
        address id;
        uint256 amount;
    }
    struct Collateral {
        address id;
        uint256 amount;
        uint256 entryPrice;
        uint256 liqPrice;
        uint256 closePrice;
        uint256 inverted;
    }
    struct Status {
        bool isClosed;
        bool isExpired;
        bool isStoploss;
        bool isBaseLiquidated;
        bool isCollateralLiquidated;
    }
    struct TradePosition {
        bytes32 positionKey;
        address owner;
        address pool;
        BaseToken baseToken;
        QuoteToken quoteToken;
        Collateral collateral;
        uint256 deadline;
        uint256 stoplossPrice;
        uint256 fee;
        uint256 protocolFee;
        Status status;
        address closer;
    }
    struct OpenTradePositionParams {
        address baseToken;
        address quoteToken;
        address collateral;
        uint256 baseAmount;
        uint256 quoteAmount;
        uint256 collateralAmount;
        uint256 deadline;
        uint256 stoplossPrice;
    }
    struct CloseTradePositionParams {
        bytes32 positionKey;
        bytes data0;
        bytes data1;
    }

    function factory() external view returns (address);

    function position(uint256) external view returns (TradePosition memory);

    function positionIndex(bytes32) external view returns (uint256);

    function openingPositionKeys(uint256) external view returns (bytes32);

    function openingPositionKeyIndex(bytes32) external view returns (uint256);

    function positionLength() external view returns (uint256);

    function openingPositionLength() external view returns (uint256);

    function userPositionLength(address) external view returns (uint256);

    function positionKeyByUser(
        address _user,
        uint256 _index
    ) external view returns (bytes32);

    function getMinCollateralAmount(
        address _baseToken,
        address _quoteToken,
        address _collateral,
        uint256 _baseAmount
    ) external view returns (uint256);

    function getQuoteAmountRange(
        address _baseToken,
        address _quoteToken,
        address _collateral,
        uint256 _baseAmount,
        uint256 _collateralAmount
    ) external view returns (uint256 minQuoteAmount, uint256 maxQuoteAmount);

    function previewTradePosition(
        OpenTradePositionParams memory
    ) external view returns (TradePosition memory);

    function canLiquidate(bytes32) external view returns (bool);

    function openTradePosition(
        OpenTradePositionParams memory
    ) external returns (bytes32 positionKey);

    function updateStatus(bytes32) external;
}
